    <ul style={StyleUl}> 
    <li> <Link to ="/"> Home </Link></li>
    <li> <Link to ='/add-employees' > Add Employees </Link></li>
    <li> <Link to ='/employees-list' > Employees List </Link> </li> 
    </ul>
    </div>
  );
}
const StyleNav ={
    diplay: "flex",
    width: '100%',
    alignmentItems: "center",
